import React from 'react'

function Card(){
    return(
        <div className='bg-light-green dib pa3 ma2 grow ml3'>
            <img alt='robo' src='https://robohash.org/test?200x200'/>
            <div>
                <h2>John Doe</h2>
                <p>john.doe@gmail.com</p>
            </div>
        </div>
    )
} 
export default Card
